import React from "react";

const About = () => {
    return (
      <About className="About">
        <div className="toggle-options">

            <p>
                
            Born and raised in San Francisco, I see the world as a tapestry of interconnected stories—each subject shaped by its context. 
            I’m driven by curiosity and a desire to understand how perspectives shape our experiences.
            
            </p>

            <p>     

            As a student of the University of California, Santa Cruz, my infatuation with technology would later evolve into a deep curiosity about its impact on society, creativity, and human connection. 
            This passion led me to explore how innovation shapes our world, driving me to pursue opportunities at the intersection of technology, storytelling, and problem-solving. 
            Wether it was developing a smart water usage monitor or competing in local pitch competitions with friends, I began to see that collaboration and technology have a powerful impact upon society.

           </p>


        </div>

      </About>
    );
  };

  export default About;
